import React from 'react';
import style from './Botao.module.scss';

class Botao extends React.Component<{
  type?: string
}> {
  render() {
    const { type = 'button' } = this.props
    return (
      <button type={type} className={style.botao}>
        {this.props.children}
      </button>
    )
  }
}

export default Botao;
